import styles from './Button.module.css';
import React from 'react';

const Button = (props) => {
    return (
        <div>
            <button className={`${props.isOutline ? styles.outline_btn : styles.primary_btn}`}>{props.icon}
                {props.text}
            </button>

        </div>
    )
}

export default Button
